insert into book_review (id, text, time, book_id, user_id) values (7, 'Praesent blandit. Nam nulla. Integer pede justo, lacinia eget, tincidunt eget, tempus vel, pede. Morbi porttitor lorem id ligula. Suspendisse ornare consequat lectus.', '2021-02-11 17:59:08', 98, 3);
